import React, { Component } from "react";
import CollectionList from "../Components/CollectionList";
import MenList from "../Components/MenList";
import WomenList from "../Components/WomenList";
import SportsList from "../Components/SportsList";
import NewRelData from "../Data/NewRelData";

class NavCategory extends Component {
  render() {
    console.log(NewRelData);
    // const { fifthbox, index } = this.props;
    return (
      <li className="mainCategoryItem">
        <a className="mainCategoryLink" href>
          NEW RELLEASES
        </a>
        <div className="NRContainer">
          <div className="NRCenter">
            <div className="nrFirstContainer">
              <ul className="categoryTemaList">
                <li className="categoryTemaItem">
                  <a className="categoryTemaLinkMain" href>
                    {NewRelData[0].categoryTitle}
                  </a>
                </li>
                {NewRelData[0].subcategory?.map((el) => {
                  return (
                    <CollectionList
                      //   key={firstData.id}
                      //   index={i}
                      subcategory={el}
                    />
                  );
                })}
              </ul>
            </div>

            <div className="navCategoryLine"></div>

            <div className="nrSecondContainer">
              <ul className="nrMenList">
                <li className="nrMenItem">
                  <a className="nrMenLinkMain" href>
                    {NewRelData[1].categoryTitle}
                  </a>
                </li>
                {NewRelData[1].subcategory?.map((el) => {
                  return (
                    <MenList
                      //   key={firstData.id}
                      //   index={i}
                      subcategory={el}
                    />
                  );
                })}
              </ul>
            </div>
            <div className="nrThirdContainer">
              <ul className="nrWomenList">
                <li className="nrWomenItem">
                  <a className="nrWomenLinkMain" href>
                    {NewRelData[2].categoryTitle}
                  </a>
                </li>
                {NewRelData[2].subcategory?.map((el) => {
                  return (
                    <WomenList
                      //   key={firstData.id}
                      //   index={i}
                      subcategory={el}
                    />
                  );
                })}
              </ul>
            </div>
            <div className="navCategoryLine"></div>
            <div className="nrFourthContainer">
              <ul className="nrSportsList">
                <li className="nrSportsItem">
                  <a className="nrSportsLinkMain" href>
                    {NewRelData[3].categoryTitle}
                  </a>
                </li>
                {NewRelData[3].subcategory?.map((el) => {
                  return (
                    <SportsList
                      //   key={firstData.id}
                      //   index={i}
                      subcategory={el}
                    />
                  );
                })}
              </ul>
            </div>
            <div className="nrFifthContainer">
              <ul className="nrBrandList">
                <li className="nrBrandItem">
                  <a className="nrBrandLink" href>
                    {NewRelData[4] && NewRelData[4].categoryTitle}
                  </a>
                </li>
                {NewRelData[4].subcategory?.map((el) => {
                  return (
                    <SportsList
                      //   key={firstData.id}
                      //   index={i}
                      subcategory={el}
                    />
                  );
                })}
              </ul>
            </div>
          </div>
        </div>
      </li>
    );
  }
}

export default NavCategory;
